import React from 'react'



function TrendingCard(props){
    console.log(props.data)

    return(props.data.map((e)=>{
        return <div Key={e.attributes.id}>
            <h1>{e.attributes.id}</h1>
        </div>
    }))
}

export default TrendingCard
